    mat = [[0 for _ in range(3)] for _ in range(3)]
    res[0][0] = res[1][1] = res[2][2] = 1
    mat[0][0] = a
    mat[0][1] = b
    mat[0][2] = mat[1][0] = mat[2][2] = 1
    mat[1][1] = mat[1][2] = mat[2][0] = mat[2][1] = 0
    if n <= 2:
        return 1 % m

    def mul(res, mat, m):
        res1 = [[0 for _ in range(3)] for _ in range(3)]
        for i in range(3):
            for j in range(3):
                for k in range(3):
                    res1[i][j] += res[i][k] * mat[k][j]
                    res1[i][j] %= m
        for i in range(3):
            for j in range(3):
                res[i][j] = res1[i][j]

    def mat_exp(n, m):
        while n > 0:
            if n & 1:
                mul(res, mat, m)
            mul(mat, mat, m)
            n //= 2
    mat_exp(n - 2, m)
    return (res[1][0] + res[0][1] + c * res[0][2]) % m

